  false,\n\t\"url\": null,\n\t\"notes\": \"This record is an unpublished report evaluating
  the hazardous material / waste management impacts of a future bridge replacement
  project on highway 701 at Yauhannah Lake near the Visitor's Center for Waccamaw
  NWR. ARM Environmental Services, Inc. (ARM) has conducted a hazardous material /
  waste site assessment of the US 701 Bridge Replacements Project area, located in
  Horry and Georgetown Counties, South Carolina. The study area consists of a corridor
  that is approximately 2 miles long, 300 feet wide, and is centered on the existing
  US 701 alignment from a point near the US 701 / Trinity Road intersection in Georgetown
  County, to a point near the US 701 / Lucas Bay Road intersection in Horry County.\",\n\t\"owner_org\":
